import React, {Component} from 'react';
import {OwpPageCarded, OwpToolbar,OwpMessage,OwpSearchAutoComplete} from "owp/wrapper";
import Button from "@material-ui/core/Button/index";
import FuseHighlight from "owp/@fuse/components/FuseHighlight/FuseHighlight";
import OwpPresetAutocompleteTextField from "owp/components/Form/OwpPresetAutocompleteTextField";
import debounce from 'lodash/debounce';
import isEmpty from 'lodash/isEmpty';


class Page extends Component {

    state = {
        MFNO: '0'
    };

    render()
    {
        return (
            <React.Fragment>
                <OwpPageCarded
                    contentToolbar={
                        <OwpToolbar
                            title={"OwpAutocomplete 사용법"}
                        />
                    }
                    content={
                        <React.Fragment>
                            <FuseHighlight component="pre" className="language-js">{`

                                `}
                            </FuseHighlight>


                            <OwpToolbar
                                title={"OwpAutocomplete 예제"}
                            />

                            <OwpPresetAutocompleteTextField
                                className="autocompleteTextField"
                                // query={{ url: '/listOWP_MANUFACTPAPER_TOKEN_LIST'}}
                                query={{ url: '/listOWP_MANUFACTPAPER_TOKEN_LIST?OWP_MANUFACTPAPER.DeptName=주사제1팀'}}
                                onChange={value => {
                                    this.setState({MFNO : this.state.MFNO = value});
                                    console.log('Check...', value);
                                    //this.loadvalue();
                                }}
                                value={this.state.MFNO}
                                placeholder={"제조번호"}
                            />


                            <OwpPresetAutocompleteTextField
                                fullWidth
                                minInputLength={2}
                                id = "ACCOUNTSEQ"
                                onInputChange={debounce(
                                    inputValue => this.setState({ inputValue }),
                                    300,
                                    { maxWait: 1000 }
                                )}
                                query={
                                    !isEmpty(this.state.inputValue) && {
                                        url: '/listOWP_MANUFACTPAPER_TOKEN_LIST',
                                        params: {
                                            'OWP_MANUFACTPAPER.DeptName': '주사제1팀',
                                        },
                                    }
                                }
                                onChange={value => {
                                    this.setState({MFNO : this.state.MFNO = value});

                                }}
                                value={this.state.MFNO}
                                placeholder={"거래처명"}
                            />



                            <OwpSearchAutoComplete/>

                        </React.Fragment>

                    }innerScroll
                />
            </React.Fragment>
        )
    };
}

export default Page;
